import s from '../Header.module.css';

const PhotoWithSettings = (props) => {
    return (
        <div className={s.divClickPhoto}>
            <div>{props.myProfile.fullName}</div>
            <div className={s.item}>Settings</div>
            <div className={s.item}>Mode</div>
            <div className={s.item}>Help</div>
            <div className={s.item}>Log out</div>
        </div>
    )
}
export default PhotoWithSettings;
